import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import {
  CircularProgress,
  Grid,
  Card,
  CardActionArea,
  CardActions,
  CardContent,
  CardMedia,
  Button,
  Typography,
} from "@material-ui/core";
// hook
import { useFetch } from "../../../hooks";
// components
import CultrueCards from "./CultureCards";
import FALLBACK_IMAGE from ".../public/img/deafAndDumb.jpeg";
const onMediaFallback = (event) => (event.target.src = FALLBACK_IMAGE);

const useStyles = makeStyles({
  root: {
    md: 16,
  },
});

const ClientCulture = () => {
  const { data, isLoading } = useFetch("/cultures/group");
  const classes = useStyles();
  const cultureCards = data.map((information) => (
    <Grid key={information._id} item xs={12}>
      <Card className={classes.root}>
        <CardActionArea>
          <CardMedia
            component="img"
            alt="Contemplative Reptile"
            height="140"
            src=""
            title="Contemplative Reptile"
          />
          <CardContent>
            <Typography gutterBottom variant="h5" component="h2">
              Lizard
            </Typography>
            <Typography variant="body2" color="textSecondary" component="p">
              Lizards are a widespread group of squamate reptiles, with over
              6,000 species, ranging across all continents except Antarctica
            </Typography>
          </CardContent>
        </CardActionArea>
        <CardActions>
          <Button size="small" color="primary">
            Share
          </Button>
          <Button size="small" color="primary">
            Learn More
          </Button>
        </CardActions>
      </Card>
      <Typography variant="h6">{information._id}</Typography>
      <CultrueCards
        countrySource={information._id}
        information={information.data}
      />
    </Grid>
  ));

  return (
    <div>
      <Grid item xs={12}>
        <Grid container spacing={3}>
          {isLoading ? (
            <Grid item xs={12}>
              <CircularProgress />
            </Grid>
          ) : (
            cultureCards
          )}
        </Grid>
      </Grid>
    </div>
  );
};

export default ClientCulture;
